import React from "react";
import { Typography, Button, TextField } from "@material-ui/core";
import { withStyles } from "@material-ui/core/styles";
import { Link } from "react-router-dom";

const Home = () => {




   return (
    <div class="h-full">
      <form class="h-full flex flex-wrap content-center justify-center flex-col" noValidate autoComplete="off">
        <div class="text-center">
          <Title variant="h2" colorPrimary="white">AutoSend</Title>
        </div>
        <div class="w-96 mt-5">
          <LoginTextField label="Email" variant="outlined" fullWidth="true"/>
        </div>
        <div class="w-96 mt-3">
          <LoginTextField type="password" label="Password" variant="outlined" fullWidth="true"/>
        </div>
        <div class="w-96 mt-3 text-right"> 
          <Link to='/email'>
            <LoginButton variant="contained">Login</LoginButton>
          </Link>
        </div>


      </form>
    </div>
  );
};

export default Home;
